    false,nt"url": null,nt"notes": "These files contain 2-foot GSD high-resolution
    orthorectified aerial image map products in GeoTIFF version 6.0 file format. GeoTIFF
    files are uncompressed raster images complete with coordinate information. The VBMP
    project encompasses the entire land area of the Commonwealth of Virginia. The State
    boundary is buffered by 1000 feet. Coastal areas of the State bordering the Atlantic
    Ocean or the Chesapeake Bay are buffered by 1000 feet or the extent of man-made
    features extending from shore. 1-foot resolution digital orthoimagery was developed
    over the majority of urban/suburban areas of the Commonwealth covering approximately
    7,167 square miles and 2-foot resolution digital orthoimagery was developed over
    the rural areas of the Commonwealth covering approximately 31,923 square miles as
    defined by VGIN. 6-inch resolution digital orthoimagery was developed in limited
    urban areas covering approximately 1000 square miles.",nt"license_title": null,nt"extras":
